import React from 'react';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

export default class MembersActive extends React.Component{
    render(){
        return(
            <section>
                <h3>{props.name}</h3>
                <p>{props.id}</p>
                <p>{props.index}</p>
                <p>Active Duration:</p>
                { 
                    props.period.map((members,index) =>{
                        return(
                            <span key={index}>
                                <div>Start Time:{members.start_time}</div>
                                <div>End Time:{members.end_time}</div>
                            </span>
                        );
                    })
                } 
                <DatePicker
                    selected={new Date() ? console.log(new Date()) : console.log("null")}
                    showTimeSelect
                    maxDate={new Date()}
                    showMonthDropdown
                    showYearDropdown
                    placeholderText="Click to select a date"
                    // minTime={setHours(setMinutes(new Date(), 0), 17)}
                    // maxTime={setHours(setMinutes(new Date(), 30), 20)}
                />
                <button onClick={props.togglePopup}>CLOSE</button>
            </section>
        );
    }
}
